import React from "react";
import "./Checkmarksquare2outline2.css";

function Checkmarksquare2outline2(props) {
  const { vector, vector2 } = props;

  return (
    <div className="checkmark-square-2-outline-2">
      <img className="vector4" src={vector} />
      <img className="vector-111" src={vector2} />
    </div>
  );
}

export default Checkmarksquare2outline2;
